import React, { useState, useRef } from 'react';
import { Button } from 'primereact/button';
import { InputText } from 'primereact/inputtext';
import {Password} from 'primereact/password'
import { Dialog } from 'primereact/dialog'; 
import {register} from '../Services/AuthenticationService';
import { login } from '../Services/AuthenticationService';
const LoginDialog = (isLoginDialogVisible,handleDialogHide) => {
    const [value, setValue] = useState('');
return(
    <Dialog header="Login" visible={isLoginDialogVisible} onHide={handleDialogHide} >
      <form onSubmit={login}>
        <div className="p-field p-grid">
          <label htmlFor="username" className="p-col-fixed p-text-label">Username:</label>
          <div className="p-col" >
            <InputText type="text" id="username" required  />
          </div>
        </div>
        <br></br>
        <div className="p-field p-grid">
          <label htmlFor="password" className="p-col-fixed p-text-label" >Password:</label>
          <div className="p-col"  style={{width:'250px'}}>
          <Password  variant="filled" value={value} required toggleMask onChange={(e) => setValue(e.target.value)}
                promptLabel="Choose a password" weakLabel="Too simple" mediumLabel="Average complexity" strongLabel="Complex password"/>
          </div>
        </div>
        <br></br>
        <Button type="submit" label="Login" className="p-col-offset-4 p-col-4" style={{width:'250px'}} />
      </form>
      <div style={{ fontSize: '0.8rem', textAlign: 'center' }}>
        <p>By signing in, you agree to JourneyJOT</p>
        <p>
          <a>Terms and Conditions</a> and <a>Privacy Policy.</a>
        </p>
      </div>
    </Dialog>
    )
};
export {LoginDialog} ;
